import React from "react";
import Tour from "./Tour";
const Tours = ({ tours, removeTour, fetchTours }) => {
  return (
    <section>
      <div className="title">
        <h2>no tours left</h2>
        <button className="btn" onClick={() => fetchTours()}>
          refresh
        </button>
      </div>
      <div>
        {tours.map((tour) => {
          return <Tour key={tour.id} {...tour} removeTour={removeTour} />;
        })}
      </div>
    </section>
  );
};

export default Tours;
